import { Route, Routes, useNavigate } from "react-router-dom";
import CreatePortfolio from "./components/CreatePortfolio";
import PaperTrade from "./PaperTrade";
import Home from "./components/Home";
import { useEffect, useState } from "react";
import { userID } from "./interfaces";
import React from "react";

class App extends React.Component {
  initialState = {
    _id: {
      $oid: "",
    },
  };
  state = this.initialState;
  navigate = useNavigate();

  // use EFFECT REDIRCET TO USER ID IF IT IS NOT UNDEFINED

  handleID(userID: string) {
    this.setState({
      _id: {
        $oid: userID,
      },
    });
  }

  render() {
    // this.handleID = this.handleID.bind(this);
    <div>
      <Routes>
        <Route
          path="*"
          element={<Home userID={userID._id.$oid} handleID={handleID} />}
        />
        {/* <Route path="/createportfolio" element={<CreatePortfolio />} /> */}
        <Route path="/dashboard" element={<PaperTrade userID={userID} />} />
      </Routes>
    </div>;
  }
}
